webpackJsonp([96023019050811],{777:function(e,o){e.exports={data:{markdownRemark:{html:"<p>In a <a href=\"/posts/2016-10-07-fan-connectors.html\">previous post</a>, I found two questions about music discovery which I wanted to explore.\nI conducted a survey both online and in person soliciting the following questions:</p>\n<ol>\n<li>What was the last song you discovered?</li>\n<li>How did you discover it?</li>\n</ol>\n<p>There where 30 people surveyed so far.\nThe results are posted below:</p>\n<img style='width:500px' src='/images/posts/10-20-1-survey-results.png' />\n<p>A few interesting points:</p>\n<ol>\n<li>I found one maven who found rap mixtapes with a special app for leaking mixtapes</li>\n<li>The lions share of discovery is via youtube and friends</li>\n</ol>\n<p>This is a crude survey because for several reasons:</p>\n<ol>\n<li>Discovery is most likely sector specific (age, genre, location, etc.), and I got mostly college students to respond</li>\n<li>Its only 30 people</li>\n</ol>\n<p>However, it gives me a string to start pulling.</p>\n<p>Here is the next set I am curious about:</p>\n<ol>\n<li>How are people discovering music on Youtube?</li>\n<li>What where the people doing with their friends when they discovered the new music?</li>\n</ol>",frontmatter:{title:"Fan Connectors- Part 2"},fields:{date:"2016-10-25"}}},pathContext:{url:"/posts/2016-10-25-fan-connectors-2/"}}}});
